This, and its companion Hercules on the E., form under oblique illumination a very beautiful pair, scarcely surpassed by any other similar objects on the first quadrant. Its lofty rampart, 55 miles in diameter, is surmounted by peaks, which on the N. tower to an altitude of nearly 11,000 feet. It exhibits an approach to a polygonal outline, the lineal character of the border being especially well marked on the N. The;
detail on the somewhat dark interior will repay careful scrutiny with high powers. There is a small but distinct central mountain, south of which stands a number of smaller hills, forming with the first a circular;
arrangement, suggestive of the idea that they represent the relics of a large central crater. Several clefts may be seen on the floor under suitable illumination, among them a forked cleft on the N.E. quarter, and two others, originating at a dusky pit of irregular form situated near the foot of the S.E. wall, one of which runs W. of the central hills, and the other on the opposite side. A ridge, at times resembling a light marking, extends from the central mountain to the N. border. During the years 1870 and 1871 I bestowed some attention on the dusky pit, and was led to suspect that both it and the surrounding area vary considerably in tone from time to time. Professor W.H. Pickering, observing the formation in 1891 with a 13 inch telescope under the favourable atmospheric conditions which prevail at Arequipa, Peru, confirmed this supposition, and has discovered some very interesting and suggestive facts relating to these variations, which, it is hoped, will soon be made public. On the plain a short distance beyond the foot of the _glacis_ of the S.E. wall, I have frequently noted a second dusky spot, from which proceeds, towards the E., a long rill-like marking. On the N. there is a large formation enclosed by rectilineal ridges. The outer slopes of the rampart of Atlas are very noteworthy under a low sun.

A ring-plain, 30 miles in diameter, on the rocky barrier,;
extending in nearly a straight line from Hippalus to Cichus. Its terraced;
walls, which rise on the E. more than 6000 feet above the floor, are;
broken on the S. by a narrow valley, and on the E. by a small crater. A;
small central mountain is apparently the only object on a very dark;
interior.

A small and very irregularly-shaped enclosure (difficult to;
see satisfactorily) on the S. flank of the Apennines. It is hemmed in on;
every side by mountains.

The more westerly of a remarkable pair of ring-plains, of which Ritter is the other member, situated on the E. side of the Mare;
Tranquilitatis a little N. of the lunar equator. It is about 18 miles in diameter, and has a low continuous border, which includes a central mountain on a bright floor. From a mountain arm extending from the S. wall, run in a westerly direction two nearly parallel clefts skirting the edge of the Mare. The more southerly of these terminates near a depression on a rocky headland projecting from the coast-line, and the other stops a few miles short of this. A third cleft, commencing at a point N.E. of the headland, runs in the same direction up to a small crater near the N. end of another cape-like projection. At 8 h. on April 9, 1886, when the morning terminator bisected Sabine, I traced it still farther in the same direction. All these clefts exhibit considerable;
variations in width, but become narrower as they proceed westwards.
